rollback;
begin transaction;
/*Begin Dropping Tables*/
	/*Level 2 Tables*/
		drop table if exists exerciselog;
		drop table if exists accountsubscription;
		drop table if exists exercisesubscription;
	/*Level 1 Tables*/
		drop table if exists account;
	/*Level 0 Tables*/
		drop table if exists exercise;
		drop table if exists accounttype;
/*End Dropping Tables*/

/*Begin Creating Tables*/
	/*Level 0 Tables*/
		create table accounttype (
			typeid            serial  not null unique,
			description       text    not null unique,
			constraint pk_accounttype primary key (typeid)
		);
		create table exercise (
			exerciseid        serial  not null unique,
			description       text    not null unique,
			unit              text    not null,
			constraint pk_exercise primary key (exerciseid)
		);
	/*Level 1 Tables*/
		create table account(
			userid            serial  not null unique,
			username          text    not null unique,
			"password"        text    not null,
			salt              text    not null,
			fullname          text    not null,
			email             text    not null unique,
			pictureurl        text,
			privateprofile    boolean not null,
			typeid            int     not null,
			constraint pk_account primary key (userid),
			constraint fk_accounttype foreign key (typeid) references accounttype (typeid)
		);
	/*Level 2 Tables*/
		create table accountsubscription(
			subscriberid      int     not null,
			subscribeeid      int     not null,
			constraint pk_accountsubscription primary key (subscriberid, subscribeeid),
			constraint fk_subscriber foreign key (subscriberid) references account (userid),
			constraint fk_subscribee foreign key (subscribeeid) references account (userid)
		);
		create table exerciselog(
			exerciselogid serial  not null,
			exerciseid        int     not null,
			userid            int     not null,
			units             numeric not null,
			note              text,
			occourred         date    not null,
			constraint pk_exerciselog primary key (exerciselogid),
			constraint fk_exercise foreign key (exerciseid) references exercise (exerciseid)
		);
		create table exercisesubscription(
			exercisesubscriptionid serial  not null,
			exerciseid        int     not null,
			userid            int     not null,
			constraint pk_exercisesubscription primary key (exercisesubscriptionid),
			constraint fk_exercisesub foreign key (exerciseid) references exercise (exerciseid)
		);
	
/*End Creating Tables*/

/*Begin Filling Tables*/
	/*Level 0 Tables*/
		/*accounttype*/
		/*exercise*/
	/*Level 1 Tables*/
		/*account*/
	/*Level 2 Tables*/
		/*accountsubscription*/
		/*exerciselog*/
